import React from 'react';


export default function Main(props){
    const w=window.outerWidth;
     var h1=0;
     if(w>500)
     {
         h1=250;
     }
     else{
         h1=200;
     }

    return(
        <>
        <div className="main-file" style={{
            width:"300px",
            height:`${h1}px`,
            border:"1px solid lightgray",
            display:"flex",
            flexDirection:"column",
            justifyContent:"center",
            alignItems:"center",
            borderRadius:"10px",
            fontSize:"10px"
        }}>

            <h2>{props.text}</h2>
            <img src={props.image} alt="" style={{
                width:"80%",
                height:"80%"
            }}/>
        </div>
        </>
    )
}
